script: |
  super -f text -I q9372.spq | sort > q9372.out

inputs:
  - name: q9372.spq
    data: |
      SELECT DISTINCT - col1 * - - 59 FROM tab0 (FORMAT parquet) WHERE NOT ( NOT col2 NOT BETWEEN - col2 AND + + col1 * - ( 24 ) * col2 * - 18 ) OR + + col0 IS NOT NULL;
  - name: tab0

outputs:
  - name: q9372.out
    data: |
      -1239
      -4779
      -59
